import React from 'react';
import './Tag.scss';
import tags from '../../tags';

export const TAG_TYPES = {
    SMALL : 'tag-small',
    BIG : 'tag-big'
}

const Tag = ({ types, color}) => (
    <div
        className='types'
        style={{ backgroundColor: props.color }}
    >
        {props.name}
    </div>
)

export default Tag
